// import Title from "./Title";
import Subtitle from "../../../components/Subtitle";

export default function About() {
  const aboutStyle = {
    position: "relative",
    color: "#fff",
    height: "480px",
  };

  return (
    <>
      <section className="section about" style={aboutStyle}>
        {
          /*
          <Nav
          // name={canine.name}
          // description={canine.description}
          // id={canine.id}
          />
          <Title />
          */
          <Subtitle subTitle="Work" topPosSubTitle="80vh" />
        }
      </section>
    </>
  );
}
